Au sein du ministère chargé de l’Economie, la DGCCRF veille au bon fonctionnement des marchés, au bénéfice des consommateurs et des entreprises.

La DGCCRF agit en faveur :
- du respect des règles de la concurrence ;
- de la protection économique des consommateurs ;
- de la sécurité et de la conformité des produits et des services.

Autorité de contrôle, elle intervient :
- sur tous les champs de la consommation (produits alimentaires et non-alimentaires, services) ;
- à tous les stades de l’activité économique (production, transformation, importation, distribution) ;
- quelle que soit la forme de commerce : magasins, sites de commerce électronique ou liés à l'économie collaborative, etc.

INFOCOM'94 est une structure de mutualisation informatique territoriale qui met à disposition de ses adhérents des services applicatifs. Ses principales missions  :
    La recherche et la mise à disposition de progiciels métiers, exploités sur son site central et adaptés aux besoins spécifiques des Communes et Communautés d’Agglomération;
    La mise en production et l'exploitation de ces progiciels;
    Assurer directement ou indirectement la formation des agents des Collectivités à l’utilisation de ces applications métiers;
    Veiller et mettre en œuvre les évolutions de maintenance réglementaire ou techniques de ces progiciels d’applications tout en prenant en compte les nouveaux besoins des collectivités adhérentes.

Cette association a pour objet de proposer des activités qui visent à développer le lien social autour de
l'éducation et de la famille ainsi que dans les entreprises ; Pour financer son fonctionnement l'association exerce
des activités économiques ;

L'Observatoire du Développement Durable de Corse est un lieu de travail et d'échange entre les acteurs régionaux basé sur des diagnostics partagés.

Sa mission s’accomplit au travers de trois axes :

    Optimisation des moyens mis en œuvre au niveau régional pour la connaissance et la gestion des données (collecte) ;
    Optimisation des échanges et de l'utilisation des données par les partenaires (diffusion) ;
    Réalisation de documents de synthèse pour une vision globale (compréhension).

Il s’agit, dans une stratégie qui traite de manière intégrée les aspects économiques, environnementaux et sociaux, de procéder à la collecte, au traitement et à la diffusion de données, informations, initiatives développées pour répondre aux défis majeurs tels que le changement climatique, la préservation de la biodiversité, les énergies renouvelables, la gestion des ressources naturelles, mais aussi la gouvernance.

L'Agence de mutualisation des universités et des établissements d'enseignement supérieur ou de recherche et de support à l'enseignement supérieur ou à la recherche (connue sous le sigle Amue) est un groupement d'intérêt public français créé en 1992, placé sous la tutelle du Ministère de l'enseignement supérieur, de la recherche et de l’innovation.

Ses principales missions sont d’organiser la coopération et servir de support aux actions communes de ses adhérents en vue d’améliorer la qualité de leur gestion1 :

en contribuant à l’élaboration de leur système d’information ;
en leur permettant de disposer d‘une offre logicielle plurielle répondant à leur diversité ;
en accompagnant les changements et la modernisation des établissements en matière de pilotage et de gestion, par la veille, les échanges et l’expertise
en assurant à leurs personnels des formations ;
en mutualisant les coûts via une centrale d’achats
en participant à la construction de l’Espace européen de l’enseignement supérieur et de la recherche et à la coopération internationale

Créé par les Carif-Oref régionaux en 2011, le Réseau des Carif-Oref intervient à l’échelle nationale. 
Il est la traduction d’une volonté partagée de poursuivre et d’adapter la synergie de moyens et de compétences entre les Carif-Oref
Il doit également assurer une articulation optimale des attentes et apports des acteurs nationaux, interrégionaux et régionaux. 


Pour répondre à ces objectifs, RCO poursuit 7 missions spécifiques :




1/ La consolidation, l’agrégation et la transmission à l’État des informations sur l'offre de formation professionnelle continue et l'apprentissage collectées par les Carif et les Oref ;
2/ La gestion du référencement des organismes et de leurs sites de formation professionnelle et d’apprentissage ;
3/ La coordination des actions des Carif-Oref en matière d’identification, de documentation, de diffusion et de promotion des innovations technologiques et pédagogiques dans les domaines de l’orientation et de la formation professionnelles ;
4/ La coordination d’un bilan annuel consolidant les informations sur l’offre de formation professionnelle ;
5/ La représentation de ses adhérents auprès des instances, acteurs et pouvoirs publics au niveau national ;
6/ L’organisation de la mise à disposition de toutes données nécessaires à l’exécution des missions confiées aux Carif-Oref ;
7/ La mise en œuvre de toutes autres actions qui lui sont confiées par l’État et/ou une ou plusieurs régions en relation avec ses missions.

Contact OpenData CertifInfo : opendata@intercariforef.org

Inno³ est un cabinet de conseil en innovation ouverte, indépendant et spécialiste de l'open data et de l'open source.

De l'audit de code à l'évaluation des politiques de valorisation, nos compétences s'étendent de la gestion de la propriété intellectuelle, à la transformation d'organisation et à la mise en place de dynamiques d'écosystème : 
- **dynamique d'écosystème**: Innovation ouverte collaborative, approche communautaire, création d'écosystèmes;
- **transformation organisationnelle**: Audit d'organisation, transformation des processus, innersourcing et contributions;
- **audit de conformité**: Constitution de la nomenclature, analyse du risque, mise en conformité;
- **politiques de valorisation**: Gestion de la Propriété Intellectuelle, licences et pratiques open source, modèles économiques adaptés.

En tant qu'acteur de cette dynamique collaborative, le cabinet s'implique activement dans les chantiers structurants du secteur, au travers d’interviews, de conférences, mais aussi d’investissements plus importants au sein d'événements forts, tels que : [Numérique En Communs](https://numerique-en-communs.fr/) (NEC), [B-BOOST](https://b-boost.fr/), [Paris Open Source Summit](https://2019.opensourcesummit.paris/) (POSS), [European Open source & Law Event](http://eolevent.eu/) (EOLE), etc.

Inno³ s'inscrit également dans des **démarches de science ouverte** dans le cadre de projet de recherche et d'études avec la publication d'articles et de rapports en libre accès, la mise à disposition des jeux de données anonymisés et les codes sources ayant servi à leur traitement.

La Caisse des Dépôts est un établissement financier public qui remplit des missions d’intérêt général en appui des politiques publiques. Une mission confiée par la loi. Gestionnaire de confiance pour le compte de tiers, investisseur et prêteur de long terme, la Caisse des Dépôts facilite la réalisation de projets innovants, durables et solidaires et participe au développement économique du pays.
Avec l’arrivée en 2020 du groupe la Poste au sein du groupe Caisse des Dépôts, celui-ci devient le premier pôle financier public français, l’un des plus importants au monde. 
Organisé autour de 5 métiers, il s’engage au quotidien à réduire les inégalités sociales et territoriales.   
La Banque des Territoires conseille, finance, opère tous les projets auprès des collectivités locales, des organismes de logement social, des entreprises publiques locales et des professions juridiques pour des territoires plus durables, inclusifs, attractifs et connectés ;
Bpifrance accompagne les entreprises avec un continuum de financement (prêts, garanties, prises de participation, conseil et accompagnement) à toutes les étapes de leur développement, en France et à l’international ;
Retraites et solidarités, métier historique de gestionnaire de mandats publics, la Caisse des Dépôts est un acteur majeur de la cohésion sociale, assurant un rôle dans la qualification professionnelle de 33 millions de Français et contribuant au défi du régime universel des retraites. Elle est aussi en charge du nouveau Compte personnel de formation ;
La gestion des actifs permet à la Caisse des Dépôts de financer et d’accompagner des projets d’intérêt général sur tous les territoires. Le Groupe contribue au financement de l’économie française avec une prise en compte toujours plus forte des critères Environnementaux, Sociaux et de Gouvernance (ESG). 
Gestion des participations stratégiques, elle accompagne dans la durée le développement de ses filiales dont les résultats financiers soutiennent ses missions d’intérêt général (Transdev, Egis, Icade, Compagnie des Alpes, RTE...).
Pour plus d’informations : www.caissedesdepots.fr.

Santé publique France est l’agence nationale de santé publique. Créée en mai 2016 par ordonnance et décret, c’est un établissement public administratif sous tutelle du ministère chargé de la Santé. Sa mission : améliorer et protéger la santé des populations. Cette mission s'articule autour de trois axes majeurs : anticiper, comprendre et agir.


### Santé publique France en quelques mots :

En tant qu'agence scientifique et d’expertise du champ sanitaire, Santé publique France a en charge :
- l'observation épidémiologique et la surveillance de l'état de santé des populations ;
- la veille sur les risques sanitaires menaçant les populations ;
- le lancement de l'alerte sanitaire ;
- la promotion de la santé et la réduction des risques pour la santé ;
- le développement de la prévention et de l'éducation pour la santé ;
- la préparation et la réponse aux menaces, alertes et crises sanitaires.

Le SIDESA est un syndicat mixte regroupant 64 collectivités compétentes en eau, assainissement et ruissellement sur le territoire des départements de Seine-Maritime et de l'Eure.

La mission du Syndicat InterDépartemental de l'Eau Seine Aval est l’information des élus, la coordination des politiques de l’eau, la représentation des collectivités devant les pouvoirs publics et l'assistance à maîtrise d'ouvrage. 

Le SIDESA impulse les politiques de mise en œuvre des directives européennes, du Grenelle et du SDAGE : études de bassins de captages prioritaires, accélération des procédures de protection des captages, études de sécurisation de la production, diagnostics de réseau, mise aux normes des stations d’épuration, etc.

Il apporte à ses adhérents, dans le domaine de l’eau potable, de l’assainissement et des bassins versants  :
- une assistance juridique et technique ;
- une assistance à maîtrise d’ouvrage pour les marchés publics et les délégations de service public pour les collectivités adhérentes et non adhérentes ;
- La réalisation d'études : audits de contrats de DSP, audits de fonctionnement des services d'eau et d'assainissement, transfert de compétences, arrêtés et schémas de défense extérieure contre l'incendie, etc. pour les collectivités adhérentes et non adhérentes.

Il exerce également une mission d’études générales à l’échelle du département :

- Schéma départemental de production d’eau potable en 2001;
- Schéma départemental d’élimination des matières de vidanges de l’assainissement non collectif et des sous-produits du collectif en 2005;
- Schéma départemental d’assainissement collectif en 2009-2010;
- Enquête sur le prix de l’eau

Née de la volonté des élus des Pays de Savoie pour mutualiser les moyens et les compétences en information géographique, la RGD a toujours su innover pour s’adapter aux besoins de ses utilisateurs en leur apportant une expertise et une infrastructure technique. Sa politique d’ouverture et de partenariat lui permet de mettre en œuvre des projets ambitieux comme le Plan de corps de rue simplifié (PCRS) ou la plateforme de diffusion de données numériques (Data Savoie Mont Blanc), et de conserver son avance technologique reconnue au niveau local, régional, et national.

Le sens du service public, l’écoute des besoins, le respect mutuel, l’esprit d’équipe, l’enthousiasme, l’intégrité, et la transparence sont au cœur de notre engagement.

La Régie de Gestion des Données Savoie Mont Blanc a pour missions principales de :
- Organiser et structurer un système de base de données certifiées;
- Mutualiser l’acquisition et la mise à jour des données au bénéfice des acteurs publics;
- Diffuser les données et les géoservices en garantissant leur souveraineté;
- Apporter un appui technique de proximité aux utilisateurs d’information géographique des Pays de Savoie;
- Animer la communauté des géomaticiens et assurer sa représentation au niveau régional et national;
- Promouvoir l’innovation, et concevoir de nouveaux services pour valoriser le dynamisme des collectivités.

la direction générale des collectivités locales est une direction du ministère de l’Intérieur, placée sous l'autorité de la ministre de la Cohésion des territoires et des Relations avec les collectivités territoriales.

La direction générale des collectivités locales (DGCL) est chargée d’élaborer l’ensemble des dispositions concernant les collectivités territoriales, de répartir les concours financiers de l’État entre ces collectivités, de mettre en place les statuts des acteurs locaux (élus et personnels) et de définir les orientations relatives à la politique nationale et européenne de cohésion des territoires et de politique de la ville. La DGCL est rattachée au ministère de l'Intérieur et au ministère de la Cohésion des Territoires et des Relations avec les Collectivités Territoriales.

Les missions de la DGCL sont : 
-Assurer le respect des règles juridiques applicables aux collectivités territoriales ;
-Préparer les textes sur l’organisation, les compétences et le financement des collectivités locales ;
-Animer les instances de concertation entre l’État et les collectivités territoriales ;
-Répartir les concours financiers de l’État aux collectivités territoriales ;
-Préparer les règles budgétaires et fiscales des collectivités locales ;
-Élaborer les statuts applicables aux élus locaux et aux fonctionnaires territoriaux ;
-Élaborer les orientations relatives à la politique nationale et européenne de cohésion des territoires et de politique de la ville ;
-Proposer les orientations et suivre l’exécution des fonds structurels européens et d’investissement, en lien avec l’agence nationale de cohésion des territoires (ANCT) dont la DGCL assure la tutelle ;
-Fixer les orientations relatives aux instruments contractuels de mise en œuvre de la politique de cohésion des territoires associant l’État et les collectivités territoriales ;
-Mener des missions de coopération internationale ;
-Informer les citoyens des données et des statistiques relatives aux collectivités territoriales grâce à son département des études et des statistiques locales (DESL)

Le CLEMI (Centre pour l'éducation aux médias et à l'information), service de Réseau Canopé, opérateur du ministère de l'éducation nationale et de la jeunesse est chargé de l'éducation aux médias et à l'information (ÉMI) dans l'ensemble du système éducatif français. Fort d’un ancrage historique dans la communauté enseignante et de partenariats solides avec les médias depuis plus de 30 ans, ses missions s’organisent autour de plusieurs axes :

la formation des enseignants (du 1er et du 2nd degrés, de toute discipline) et des formateurs / éducateurs ;
la production et la diffusion de ressources pour accompagner les actions auprès des élèves, de la maternelle au lycée ;
le conseil et l’expertise, en France et à l'international ;
l'organisation d'événements, dispositifs et concours d'éducation aux médias et à l'information (Semaine de la presse et des médias dans l'École, productions de médias scolaires - Médiatiks, #ZéroCliché, Wikiconcour Lycéen...) ;
l’animation du réseau des coordonnateurs académiques.

Jeux de données calculés depuis les Demandes de Valeurs Foncières (DVF) fournies par data.gouv.fr, plateforme ouverte des données publiques françaises, et contenant les statistics par région, département, commune, des moyennes, sommes et tendances des prix du m2 bati, prix de vente, superficie, nombre de ventes, ...

**Comment accéder aux données et à l'application:**
### https://www.zimmoa.fr

Fonctionne depuis n'importe quel PC, Tablette, Smartphone ou tout équipement disposant d'un navigateur récent (post 2014)

Chaque entité (Région, Département, Commune) est accessible via l'application et son champs de recherche

Le chemin d'accès respecte le schéma suivant : 

  - https://www.zimmoa.fr/{region}
  - https://www.zimmoa.fr/{region}/{departement}
  - https://www.zimmoa.fr/{region}/{departement}/{commune}

Une recherche peut être réalisée via le chemin (en plus du champs de recherche) : 

  - https://www.zimmoa.fr/{entity}

L'application présentera la réponse qui lui semble la plus judicieuse

Les données sont disponibles dans chaque page dans le format [JSON-LD](https://json-ld.org/) et respectent autant que possible [le modele de données schema.org](https://schema.org/docs/datamodel.html)

