Le Système National d'Observation de la Sécurité des Activités Nautiques (SNOSAN) est un observatoire interministériel qui répond à la volonté de mieux connaître les caractéristiques des accidents relatifs à la plaisance et aux activités nautiques récréatives et sportives en eaux françaises.

Il est né de la conclusion d’un protocole d’accord interministériel le 2 juillet 2015 associant :

    Le Ministère chargé de la mer ;
    Le Ministère chargé des sports ;
    Le Ministère de l'Intérieur ;
    L'École Nationale de Voile et des Sports Nautiques (ENVSN) ;
    La Société Nationale de Sauvetage en Mer (SNSM).

Rappelons que le sauvetage en mer a été déclaré « Grande cause nationale » en 2017.

Le SNOSAN s’appuie sur les données provenant:

    de l’ensemble des centres régionaux opérationnels de surveillance et de sauvetage (CROSS) métropolitains et ultramarins;
    des opérations SNSM pour lesquelles les CROSS n’ont pas été avisés. A terme, il pourra s’appuyer sur les données issues des SDIS.

Le Service Départemental Métropolitain d’Incendie et de Secours (SDMIS) est un établissement public administratif doté de la personnalité juridique et de l’autonomie financière. Le SDMIS est chargé de la prévention, de la protection et de la lutte contre les incendies. Il concourt, avec les autres services et professionnels concernés, à la protection et à la lutte contre les autres accidents, sinistres et catastrophes, à l’évaluation et à la prévention des risques technologiques ou naturels ainsi qu’aux secours d’urgence. Dans le cadre de ses compétences, il exerce les missions suivantes :

1- La prévention et l’évaluation des risques de sécurité civile ;
2- La préparation des mesures de sauvegarde et l’organisation des moyens de secours ;
3- La protection des personnes, des biens et de l’environnement ;
4- Les secours d’urgence aux personnes victimes d’accidents, de sinistres ou de catastrophes ainsi que leur évacuation.

Le SDMIS est une structure unique en France qui assure ses missions au profit de deux collectivités territoriales, le département du Rhône et la métropole de Lyon, dans le cadre d’une gouvernance partagée.

Plus d'informations :
https://www.sdmis.fr

La direction des achats de l’Etat a été créée par le décret du 3 mars 2016. Placée auprès du ministre des finances et des comptes publics.


**Ses missions :**



1. définir la politique des achats de l’Etat sous l’autorité du Premier ministre . Elle s’assure également de sa mise en œuvre, après concertation avec les ministères au sein de la conférence des achats ;

2. élaborer, après concertation interministérielle au sein du comité des achats de l’Etat, les stratégies interministérielles concernant les achats relevant d’une même famille ;

3. conclure les marchés publics interministériels ou en confier la conclusion à un autre service de l’Etat, à l’Union des groupements d’achats publics, à une autre centrale d’achat public ou à un établissement public de l’Etat.. Elle s’assure de la bonne exécution de ces marchés ;

4. conseiller les services de l’Etat, et les établissements publics de l’Etat pour leurs stratégies d’achat ainsi que pour l’organisation de la fonction d’achat;

5. définir la stratégie de formation des acteurs de la fonction d’achat de l’Etat et piloter l’offre de formation en la matière ;

6. proposer les mesures permettant de renforcer la professionnalisation des acteurs de la fonction achat et de structurer leur parcours professionnel dans le cadre d’une filière d’achats commune aux services de l’Etat et aux établissements publics;

7. animer le réseau social professionnel des acteurs de la fonction achat de l’Etat ;

8. identifier et animer le réseau d’experts en achats des services de l’Etat ainsi que celui des établissements publics ;

9. concevoir et piloter le système d’information des achats de l’Etat permettant, en particulier, une simplification, rationalisation et dématérialisation de la fonction d’achat;

10. rendre compte au Premier ministre et au ministre chargé du budget dans un rapport annuel des actions mises en œuvre dans les services de l’Etat, des établissements publics de l’Etat et des organismes ainsi que des résultats obtenus.

L'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche (ESENESR) est un service à compétence nationale, fondé par arrêté du 24 août 2011 et rattaché à la direction générale des ressources humaines (DGRH) du ministère de l'éducation nationale et du ministère de l'enseignement supérieur, de la recherche et de l'innovation.
L'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche (ESENESR) est chargée de la conception, du pilotage et de la mise en œuvre de la formation des personnels d'encadrement pédagogiques et administratifs, des personnels ingénieurs, administratifs, techniques, sociaux et de santé et des personnels des bibliothèques du ministère de l'éducation nationale et du ministère de l'enseignement supérieur, de la recherche et de l'innovation, à l'exception de ceux gérés par le service de l'action administrative et de la modernisation.
Les textes suivants fixent l'organisation de l'administration centrale du ministère de l'éducation nationale, de l'enseignement supérieur et de la recherche :
- décret n° 2011-1003 du 24 août 2011 modifiant le décret n° 2006-572 ;
- arrêté du 1er juin 2015 modifiant l'arrêté du 24 août 2011 portant création de l'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche;
- arrêté du 9 septembre 2015 fixant la composition et les modalités de fonctionnement du conseil scientifique de l'ESENESR ;
- arrêté du 9 septembre 2015 fixant la composition et les modalités de fonctionnement du conseil d'orientation de l'ESENESR.

L’association dite Fédération française de vol libre, fondée en 1974, est désignée ci-après par les initiales FFVL. 
Elle a pour objet : 
- d’organiser, de diriger et de promouvoir les pratiques du vol libre (notamment aile delta, parapente, speed riding et disciplines associées), les glisses aérotractées (tout milieu, tout support), le cerf-volant, le boomerang et toute discipline connexe validée par l’assemblée générale, en France métropolitaine ainsi que dans les départements et territoires d’outre-mer, par : 
- la création d’associations et d’écoles, 
- la conception d’un enseignement spécifique, 
- les formations de tous ordres, notamment à destination des jeunes, des formateurs, des compétiteurs et des publics spécifiques, 
- l’étude et l’élaboration des programmes et règlements sportifs, 
- la recherche des moyens permettant de développer une meilleure sécurité de ces sports, 
- et d’une manière générale, l’étude de toute question relative à ses disciplines ;
- d’encourager, de soutenir, de coordonner et de contrôler l’action des associations affiliées, des écoles agréées ; 
- d’organiser les compétitions et délivrer les titres sportifs pour lesquels elle a reçu délégation ; 
- de représenter ses disciplines en tout lieu et toute circonstance ; 
- de participer aux actions de développement de ses disciplines dans le monde et plus particulièrement dans les pays de langue française ; 
- de veiller à ce que ses disciplines, à la fois sportives et techniques, restent un moyen de perfectionnement moral et favorisent l’épanouissement de la personnalité.

Pour plus d'informations sur l'OpenData à la FFVL : [https://data.ffvl.fr](https://data.ffvl.fr)

Instaurée en 2011 par délibération du Département, la politique SIG départementale, appelée Géo17, a permis d’engager une large dynamique d’acteurs et de réaliser collectivement des projets dans de nombreux domaines.

Cette  stratégie départementale permet de :
- fédérer l’ensemble des partenaires sur des objectifs communs ;
- mutualiser et maîtriser les coûts ;
- développer l’usage des S.I.G.

Afin d'assurer la réussite de cette démarche départementale, des actions ont été définies et engagées autour de principes clefs comme :
- le partage de données, de méthodes et d'expériences permettant de rendre l'information géographique disponible pour tous ;
- la mutualisation d'achats de données, de moyens, de savoir-faire permettant à chacun de profiter des acquis collectifs ;
- la normalisation des données et des processus d'échanges conformément à la directive européenne INSPIRE.
Avec le souci permanent de diminuer les coûts.

Paris est la capitale qui réunit le plus grand nombre d'instituts culturels étrangers.
Ils sont 55 réunis au sein d'une association unique au monde, de l'Amérique latine en passant par la Méditerranée, l'Europe, la Russie, l'Asie, l'Extrême et le Moyen Orient.

Le FICEP, Forum des instituts culturels étrangers à Paris, a été créé en 2002 à l'initiative du Centre culturel canadien, au-delà des accords diplomatiques, avec l'objectif de mettre en valeur le rôle clef que les instituts et les centres culturels étrangers de Paris jouent dans la promotion de la diversité culturelle.

Pour la première fois, une fédération d'instituts et centres culturels ayant à coeur la défense des cultures vivantes se crée sur une base pérenne dans une grande capitale. Des acteurs culturels s'unissent et s'expriment collectivement, au-delà de la diplomatie traditionnelle et des accords-cadres bilatéraux.


Le Ficep a pour vocation...



- d'affirmer un espace de réflexion original et multilatéral sur la culture, son statut, ses conditions d'épanouissement dans le contexte de la mondialisation;



- d'exprimer collectivement une conception de la culture vivante, tolérante, ouverte, dans l'espace public français, européen et international à égale distance de la banalisation mercantile et du repli identitaire ;



- de fédérer, réunir et faire collaborer les différents instituts ou centres culturels étrangers à Paris afin de promouvoir les différentes cultures à travers la réalisation de projets d'intérêt commun ;



- de réaliser des projets d'intérêt commun mettant en relief la diversité culturelle, telle, par exemple, la semaine des cultures étrangères ;



- de représenter ses membres auprès des grandes organisations multilatérales ou association à vocation internationale ainsi qu'auprès des autorités françaises pour déterminer avec elles les actions communes et prendre toutes les dispositions nécessaires à la réalisation de ses objectifs.

**Département de l’Indre**
