L'INERS, est une association de loi de 1901  , Cette  Institut Francais dédié à la recherche et à la formation sur les thématiques des questions  qui traitent du renseignement et des questions de sûreté/sécurité du contre-terrorisme et d'intelligence stratégique et des nouvelles technologies associées (CYBER-IA).
Fondée par Chems Akrouf, l’origine de la création de l’INERS relève de la volonté de satisfaire trois objectifs principaux :

contribuer à la recherche et au débat sur les questions du renseignement et des questions de sûreté/sécurité du contre-terrorisme et d'intelligence stratégique, en offrant une lecture différente et originale des enjeux associés ;
créer un centre d’expertise réellement indépendant ;
créer un lieu de dialogue et de réflexion entre tous ceux qui composent la communauté du renseignement et de sureté ,avec des experts et des spécialistes de haut niveau  venus d’horizons professionnels et philosophiques différents, qu’il s’agisse de responsables politiques, hauts fonctionnaires, industriels, militaires, experts et universitaires, etc.

La Communauté de communes Flandre Lys (CCFL) est un Établissement Public de Coopération Intercommunale, situé dans la région des hauts de France.
Au cœur du triangle Hazebrouck (18 KM), Béthune (15 KM), Dunkerque (60 KM) et en bordure de la Métropole Européenne de Lille (30 KM), la CCFL se compose de huit communes réparties entre les départements du Nord et du Pas de Calais.


- Nord : Estaires, Haveskerque, La Gorgue et Merville ;
- Pas de Calais : Fleurbaix, Laventie, Lestrem et Sailly sur la Lys;

La Communauté de communes Flandre Lys compte 40 239 habitants.

L’AFEMAR inscrit ses actions dans le champ de l’éducation populaire par sa volonté de construire des alternatives culturelles et sociales. Elle expérimente, confronte les points de vue et tente d’innover ses outils et méthodes afin de créer une dynamique de territoire et de favoriser l’ouverture aux autres et au monde.   

L’AFEMAR favorise une éducation populaire actuelle, qui doit permettre aux citoyens de pouvoir s’organiser et agir collectivement  en ayant prise sur leur environnement et les enjeux de société. Une éducation populaire qui doit contribuer à la construction citoyenne en :
- Favorisant une éducation tout au long de la vie (aide à la prise de responsabilité, accompagnement même dans l’échec)
- Développant les lieux d’apprentissage formel et informel (groupe de réflexion, commissions,…) ;
- Favorisant l’accès à la culture, au savoir afin que les citoyens d’aujourd’hui et de demain se forgent par eux même sans prosélytisme ;
- Rendant accessible les différentes instances administratives, techniques et financières à tous les membres de l’association ; 
- Associant les adhérents à l’élaboration et la mise en œuvre de notre projet associatif.

Ciril GROUP (cirilgroup.com) est un éditeur de logiciels et un hébergeur Cloud lyonnais, reconnu en France et dans le monde pour la fiabilité, la pérennité et la valeur ajoutée de ses technologies, solutions et services informatiques. 

Ciril GROUP est constitué de trois entités aux domaines d’activité complémentaires :

-	Ciril (ciril.net) est spécialisée depuis 40 ans dans l’édition de progiciels, systèmes d’information et portails web pensés spécifiquement pour les besoins des acteurs publics : collectivités territoriales, établissements publics, centres de gestion, SDIS, syndicats, etc. Ciril bénéficie ave son offre CIVIL d’une excellente notoriété sur les marchés publics français ;

-	Business Geografic (business-geografic.com) est un éditeur innovant spécialisé dans le domaine des Systèmes d’Information Géographique (SIG). Business Geografic révolutionne depuis 20 ans le marché mondial de la géomatique, avec des technologies et solutions cartographiques inédites intégrées au sein de sa plateforme logicielle GEO Software ;

-	SynAApS (synaaps.com) est un hébergeur Cloud Haute Qualité. SynAApS propose les plus hauts standards de sécurité et de disponibilité en matière de services PaaS - IaaS, Infogérance et Housing, grâce à ses certifications Sécurité (ISO 27001:2013) et Santé (HDS), des dispositifs PRA et PCA informatiques natifs et une offre de PRA humain.

La DDT est chargée de mettre en oeuvre les politiques d’aménagement et de développement durables des territoires en instruisant les autorisations dans ses domaines de compétences et en aidant les porteurs de projet en amont pour faciliter l'intégration de ces politiques.
A ce titre, elle assure la promotion du développement durable, veille au développement et à l’équilibre des territoires, tant urbains que ruraux, et y participe à travers les politiques agricole, d’urbanisme, de logement, de construction, d'environnement et de transport.

Elle met en oeuvre les politiques suivantes :
- l’aménagement et l’urbanisme, avec des enjeux importants de préservation des terres agricoles, de limitation de l’étalement urbain et de croissance responsable ;
- l’agriculture et la forêt avec la promotion de leurs fonctions économiques , sociales et environnementales ;
- la prévention des risques naturels et technologiques;
- le logement, l’habitat et la construction, la gestion et le contrôle des aides publiques pour la construction de logements sociaux ainsi que la rénovation urbaine des quartiers sensibles ;
- la protection et la gestion durable des eaux, des espaces naturels, forestiers et de leurs ressources,  l’amélioration de la qualité de l’environnement ;
- la protection et la gestion de la faune et de la flore sauvages.

Représenté par des régions aux identités marquées, sur un territoire grand comme le Portugal ou l’Irlande, le Massif central n’en demeure pas moins un espace cohérent aux atouts et problématiques partagés. C’est pour valoriser les premiers et trouver des solutions innovantes aux secondes que les conseils régionaux d’Auvergne, de Bourgogne, du Languedoc-Roussillon, du Limousin, de Midi-Pyrénées et de Rhône-Alpes ont décidé, le 26 août 2008 de s’unir en un groupement d’intérêt public pour le développement du Massif central.
 Le GIP Massif central a ainsi été créé par arrêté interpréfectoral le 31 mars 2009 (modifié le 7 février 2014) et se donne pour mission de :
- Fédérer les actions communes au nom des 6 Régions qui le composent et promouvoir leur politique de Massif ;
- Valoriser les actions et politiques conduites par les Régions pour le développement du Massif central auprès des autorités nationales et européennes ;
- Assumer la maîtrise d’ouvrage d’études stratégiques pour le Massif central;
 - Assurer l'autorité de gestion du programme opérationnel FEDER Massif central 2014-2020

 Depuis le 1er janvier 2016, le GIP Massif central réunit les conseils régionaux d'Auvergne Rhône-Alpes, Bourgogne-Franche-Comté, Nouvelle Aquitaine et Occitanie

**La DINUM en bref ...**
La direction interministérielle du numérique (DINUM), créée par [le décret du 25 octobre 2019](https://www.legifrance.gouv.fr/affichTexte.do?cidTexte=JORFTEXT000039281619), prend la suite de la direction interministérielle du numérique et du système d’information et de communication de l’État (DINSIC).

Elle **accompagne les ministères dans leur transformation numérique**, **conseille le gouvernement et développe des services et ressources partagées** comme le réseau interministériel de l’État, FranceConnect, data.gouv.fr ou api.gouv.fr.

Elle pilote, avec l’appui des ministères, le programme TECH.GOUV d’accélération de la transformation numérique du service public.

La DINUM est un **service du Premier ministre**, placé sous l’autorité du ministre de l’Action et des Comptes publics, et mis à la disposition du ministre de l’Économie et des Finances et du secrétaire d’État chargé du Numérique.


**Organisation**

La DINUM comprend une direction de programme, trois départements et deux pôles :

   - **la direction de programme TECH.GOUV** pilote le programme interministériel de transformation numérique du service public TECH.GOUV, dont l’incubateur de services numériques (Beta.gouv) ;
   - **le département « Infrastructures et services opérés » (ISO)** conçoit et opère des services d’infrastructures à valeur ajoutée mutualisés entre les administrations, dont le réseau interministériel de l’État (RIE) ;
    - **le département « Etalab »** coordonne la conception et la mise en œuvre de la stratégie de l’État dans le domaine de la donnée ;
    - **le département « Performance des services numériques » (PSN)** conçoit les plans d’actions interministériels en matière de mutualisation, dématérialisation, pilotage des projets et qualité des services numériques, et soutient leur mise en œuvre ;
    - **le pôle « Animation »** coordonne et soutient les départements de la direction dans la promotion de leur activité et l’animation de leurs écosystèmes. Il assure également la communication interne et la qualité des conditions de travail des agents de la direction ;
    - **le pôle « Gestion »** assure les tâches de gestion en matière de ressources humaines, de finances et d’achats.

_Pour suivre l’actualité de la DINUM et de ses projets, rendez-vous sur le [portail de la modernisation de l’action publique](http://www.numerique.gouv.fr/dinum/)._

STATUT ET MISSIONS

