• Donner de la visibilité, promouvoir et faire reconnaître les pratiques professionnelles innovantes.

Et ce, à travers la création d'un espace collaboratif numérique, l'organisation d'événements et tous les autres moyens et activités susceptibles de concourir à la réalisation de son objet social.

Unidivers, le magazine d’information culturelle loco-national du bassin rennais et de la région Bretagne. 
Sa rédaction oeuvre en faveur de trois objectifs  :
– faire connaître aux Bretons la diversité de l’activité culturelle locale ;
– suppléer une faiblesse criante du territoire breton : l’absence de diplomatie culturelle. Il est urgent de promouvoir l’extraordinaire richesse culturelle de Rennes, de l’Ille-et-Vilaine et de la Bretagne à l’échelon national et international ;
– fruit naturel de ces deux précédents points : réveiller Rennes en dynamisant ses énergies latentes, endormies ou ignorées, afin que la capitale bretonne devienne d’ici à 2020 un haut lieu français de l’art, de la culture et du savoir. Une capitale régionale européenne innovante, créative, avant-gardiste.

**Créée le 1er janvier 2001**, Saint-Malo Agglomération, Communauté d'agglomération du Pays de Saint-Malo, regroupe 18 communes entre bords de Rance et Baie du Mont-Saint-Michel : 
Cancale, Châteauneuf d'Ille-et-Vilaine, Hirel, La Fresnais, La Gouesnière, La Ville-es-Nonais, Le Tronchet, Lillemer, Miniac-Morvan, Plerguer,  Saint-Benoît-des-Ondes, Saint-Coulomb, Saint-Guinoux, Saint-Jouan-des-Guérets, Saint-Malo, Saint-Méloir-des-Ondes, Saint-Père-Marc-en-Poulet et Saint-Suliac. 

**Au cœur de la Côte d’Emeraude**, à bientôt 2h15 de Paris grâce au nouveau réseau ferroviaire en cours d’aménagement, et avec des liaisons aériennes et maritimes vers la Grande Bretagne et les îles anglo-normandes,  Saint-Malo Agglomération compte déjà près de 80 000 habitants sur environ 245 km².

**Parmi ses principaux champs de compétences, Saint-Malo Agglomération gère notamment :**
-	Le développement économique ;
-	L’enseignement supérieur et la recherche ;
-	Les transports publics (réseau de transports KSMA) ;
-	L’équilibre social de l’habitat ;
-	La collecte, le traitement des déchets ;
-	La protection et la mise en valeur de l’environnement et du cadre de vie …

Le 18 décembre 2014, le Conseil Communautaire a adopté le principe d’engager la commune dans une démarche d’ouverture de ses données publiques et a adopté la Licence Ouverte pour la réutilisation de ses données.

Les juridictions financières participent à la démarche française de gouvernement ouvert en publiant des données sur leurs activités et leurs travaux. Cette démarche est cohérente avec les articles 14 et 15 de la Déclaration des droits de l’homme et du citoyen, qui sont au fondement des missions de la Cour des comptes : dans une démocratie, le citoyen a le droit de constater, par lui-même ou par ses représentants, la nécessité de la contribution publique, de la consentir librement, d'en suivre l'emploi, et d'en déterminer la quotité, l'assiette, le recouvrement et la durée. Il a le droit de demander compte à tout agent public de son administration.

Les juridictions financières ont pris l’initiative, dès 2014, d’ouvrir des premiers jeux de données publiques et vont approfondir cette démarche. Elles veilleront, à l’avenir, à intéresser davantage le citoyen à leurs travaux, sous réserve des précautions inhérentes au fonctionnement d’une juridiction indépendante, notamment le respect des secrets protégés par la loi.

La Cour des comptes s’engage ainsi à mettre à disposition régulièrement les jeux de données suivants :

- les données budgétaires fondant l’analyse de l’exécution du budget de l’État ;

- des données sur la comptabilité générale de l’État ;

- à chaque fois que cela sera possible, les données fondant les enquêtes thématiques de la Cour ;

- les données fondant les travaux concernant les finances locales ;

- certaines données d’activité des juridictions financières, notamment la mise à jour de la liste des publications de la Cour et des moyens des juridictions financières.

La Cour des comptes travaille également, en lien avec les services du Premier ministre, à la mise en place d’un portail de données, répertorié sur le portail du Gouvernement (data.gouv.fr), afin de systématiser une stratégie de gestion des données et la démarche d’ouverture des informations publiques.

Les données publiques présentes sur cet espace sont celles des juridictions financières et organismes associés, c'est-à-dire :

- la Cour des comptes ;

- les chambres régionales et territoriales des comptes ;

- la Cour de discipline budgétaire et financière ;

- le Conseil des prélèvements obligatoires ;

- le Haut Conseil pour les finances publiques.

Pour une information à jour sur la démarche des juridictions financières, veuillez consulter le [site des juridictions financières](https://www.ccomptes.fr/Nos-activites/Donnees-publiques).

Syndicat mixte de coopération territoriale ayant pour compétences :
- l'animation et la gestion du projet Bretagne Très Haut Débit ;
- le développement des usages des réseaux de communications électroniques ;
