Structure départementale de conseil et de services pour tous les territoires de Loire-Atlantique, cette agence regroupe depuis le 1er juillet 2013 quatre organismes, satellites du Département de Loire-Atlantique :

- le CODELA (Comité d’expansion économique de Loire-Atlantique), instance de développement économique, qui accompagne les entreprises et les territoires dans leurs projets d’implantation ou de développement ;
